This is your semi-regular reminder that the tidyverse is useless without base R. Take this code:

df |&gt; 
  mutate(z = sqrt(x^2 - y^2)) |&gt; 
  filter(abs(z) &gt; 10)

It uses 7 functions, but only 2 are from the tidyverse #rstats

